import { ListItem } from "../ListItem/ListItem";
import "./LanguageContent.scss";

export const LanguageContent = () => {
  const languageArr = [English, French, German, Spanish];

  return (
    <div className="languageContentContainer">
      <div className="languageContentHeader">
        <span className="mainHeader">What is your preferred language?</span>
        <span className="secondaryHeader">Choose language</span>
      </div>

      <ul className="listOfOptions">
        {languageArr.map((el) => (
          <ListItem value={el} key={el} />
        ))}
      </ul>
    </div>
  );
};
